  false,\n\t\"url\": null,\n\t\"notes\": \"This is an Arc/Info coverage consisting
  of 7 points representing known coordinates on the earth's surface at Pipe Spring
  National Monument, Arizona. One geodetic marker was placed by the National Park
  Service; four markers are survey markers of the four corners of the boundary (they
  reflect mapping accuracy and not survey accuracy). Other markers need to be located
  and added to this coverage. The geodetic markers were collected by a Trimble GeoXT
  GPS unit with external antenna, Hurricane, and post processed in GPS Pathfinder
  Office 3.0 for differential corrections. The seventh point representing a geodetic
  marker was collected using a Trimble GeoXT GPS unit with no external antenna and
  post processed in GPS Pathfinder Office 3.1 for differential corrections.\",\n\t\"license_title\":
